import React from 'react';
import Rating from '../rating/rating';

const products=(props)=>{
    return(
                <div>
                      <div>
                          <a href={`/props.product/${props.product.id}`}><img src={props.product.image} alt="" className="product-image"/></a>
                      </div>
                      <div  className="product-title">
                          <a href={`/props.product/${props.product.id}`}><p> {props.product.name}</p></a>
                      </div>
                      
                        <Rating rating={props.product.rating} numReviews={props.product.numReviews}/>
                          
                  
                      <div>
                          <p className="product-price"> Rs {props.product.price}</p>
                      </div>
                      
                </div>
    )
}

export default products;
